import React from 'react';
import './footer.styles.css';
import { Spacer } from './footer.styles';

const Footer = () => {
	return (
		<div className="wave">
			<Spacer>
				<div className="spacer layer1">
					<div
						style={{ display: 'flex', paddingTop: '20%', justifyContent: 'center', color: 'white' }}
					>
						whats up
					</div>
				</div>
			</Spacer>
		</div>
	);
};

export default Footer;
